import { createRating } from "../actions/rating";

const initialState = {
 rate: []   
}


export default createReducer(initialState, {
  [createRating.rejected]: (state, action) => {

  },
  [createRating.fulfilled]: (state, action) => {
    console.log(action)
  },
  [createRating.rejected]: (state, action) => {

  }  
})
